import React, { Component } from 'react';

class ForgetPass extends Component {
    state = {  }
    render() { 
        return (
            <React.Fragment>
                <label>
                    Quên mật khẩu
                </label>
                <div className='forget-pass-form'>
                    <label>Nhập email của bạn để tạo mật khẩu mới</label>
                    <input type='email' placeholder='Hãy nhập email đã đăng ký'/>
                </div>
                <button className='submit'>Đăng nhập</button>
                <button className='forget-pass'>Quên mật khẩu?</button>
            </React.Fragment>
          );
    }
}
 
export default ForgetPass;
